insert into lugar (id_lugar, nombre, descripcion) values (1, 'Machu Picchu', 'La ciudad sagrada de Machu Picchu, considerada una de las diez maravillas del mundo, fue declarada Patrimonio de la Humanidad por la Unesco en 1983. La ciudadela fue descubierta por Hiram Bingham en 1911 y se encuentra sobre una montaa de granito, a unos 130 kilmetros de la ciudad de Cusco');
insert into lugar (id_lugar, nombre, descripcion) values (2, 'Mezquita Sheikh Zayed, Abu Dabi','La tercera mezquita ms grande del mundo y la mayor de los Emiratos rabes resulta a ojos de los turistas un lugar espectacular y absolutamente recomendable. Construida en honor al primer presidente del pas, la Mezquita Sheikh Zayed destaca por la altura de sus cuatro minaretes, que alcanzan los 107 metros, y por sus columnas -cuenta con 1048 en su exterior y 96 en su interior');
insert into lugar (id_lugar, nombre, descripcion) values (3, 'Angkor Wat, Siem Reap ','El templo de Angkor Wat est considerado la mayor construccin religiosa jams realizada. Situada en la provincia de Siem Riep, en Camboya, es una de las partes integrantes de un vasto complejo de templos edificados en la zona de Angkor');
insert into lugar (id_lugar, nombre, descripcion) values (4, 'Baslica de San Pedro (Vaticano)','El cuarto sitio imprescindible en opinin de los viajeros de TripAdvisor es la baslica de San Pedro del Vaticano, uno de los rincones ms sagrados del catolicismo.');
insert into lugar (id_lugar, nombre, descripcion) values (5, 'Taj Mahal, Agra','Y es que esta joya histrica, fruto del amor, es un gran mausoleo de mrmol blanco construido por el emperador mongol Shah Jahan en honor su esposa favorita fallecida durante el parto de uno de sus hijos. ');
insert into lugar (id_lugar, nombre, descripcion) values (6, 'Mezquita-Catedral de Crdoba','La Mezquita-Catedral de Crdoba es, como en aos precedentes, la atraccin turstica preferida por los viajeros de todo el mundo, a tenor de los comentarios y opiniones plasmados en el portal de TripAdvisor.');
insert into lugar (id_lugar, nombre, descripcion) values (7, 'Iglesia del Salvador sobre la sangre derramada, San Petersburgo','la iglesia del Salvador sobre la sangre derramada, caracterizada por una pintoresca silueta multicolor, se ha convertido en uno de los edificios ms emblemticos de San Petersburgo. ');
insert into lugar (id_lugar, nombre, descripcion) values (8, 'La Alhambra, Granada','La antigua y extraordinaria ciudad amurallada granadina est considerada la mxima expresin del arte musulmn en Europa. Cruzar las murallas de la Alhambra supone retroceder mil aos.');
insert into lugar (id_lugar, nombre, descripcion) values (9, 'Piscina reflectante del monumento a Lincoln, Washington DC','La piscina reflectante del monumento a Lincoln en el National Mall es todo un smbolo de la capital americana. Diseado por Henry Bacon y construido a principios de los aos 20 del siglo pasado, ha sido escenario de grandes acontecimientos histricos, como el famoso discurso de Martin Luther King de 1963.');
insert into lugar (id_lugar, nombre, descripcion) values (10, 'Duomo de Miln (Italia)','El Duomo de Miln, la catedral gtica convertida en el autntico smbolo de la ciudad, no deja indiferente ni por su belleza ni por sus dimensiones -es uno de los templos catlicos ms grandes del mundo, con capacidad para 40.000 personas-. ');
insert into lugar (id_lugar, nombre, descripcion) values (11, 'Puente Golden Gate, San Francisco','El Golden Gate, el emblemtico puente de San Francisco que une la pennsula por el norte con Marin, fue inaugurado en 1937. Desde entonces y hasta 1964, su estructura, considerada por la American Society of Civil Engineers una de las maravillas del mundo moderno, fue el puente colgante ms largo del mundo. ');
insert into lugar (id_lugar, nombre, descripcion) values (12, 'Museo-iglesia de Santa Sofa, Estambul','El monumento ms espectacular del arte bizantino tiene un nombre: Santa Sofa y se encuentra en Estambul. Construida en el siglo IV, fue durante sus diez primeros siglos catedral cristiana para convertirse en 1453 en mezquita, uso que se mantuvo hasta 1935, cuando se transform definitivamente en museo');
insert into lugar (id_lugar, nombre, descripcion) values (13, 'Grand Place, Bruselas','En la Grand Place de Bruselas, la gran joya de la capital belga, convergen edificios renacentistas, gticos, neoclsicos y de estilo flamenco, en una armona que la ha llevado a ser considerada una de las ms hermosas de Europa. ');
insert into lugar (id_lugar, nombre, descripcion) values (14, 'Torre Eiffel, Pars','Esta estructura de hierro, cuya construccin se inici el 26 de enero de 1887, se ha convertido no slo en el emblema de Pars, sino en el autntico smbolo de Francia. ');
insert into lugar (id_lugar, nombre, descripcion) values (15, 'Catedral de Notre Dame, Pars ','La gran catedral de Pars y uno de los templos gticos ms antiguos del continente, Notre Dame, se sita en el puesto nmero en el ranking de atracciones tursticas ms populares del mundo, segn los viajeros de TripAdvisor.');
